import React from 'react';
import './App.css';
import logo from './logo.png';
import { BrowserRouter as Router, Switch, Route, Link, Routes } from 'react-router-dom';
import SellAnItem from './SellAnItem';

function App() {
  return (
    <Router>
      <div className="container">
        <img src={logo} alt="Logo" style={{ width: '300px', height: '90px', marginBottom: '80px', marginTop: '30px' }} />
        <button className="button">Mint Token</button>
        <div>
          <Link to="/sell"><button className="button">Sell an Item</button></Link>
        </div>
        <button className="button">List all items for sale</button>
        <button className="button">Change price of an item</button>
      </div>
      <Routes>
        <Route path="/sell" component={SellAnItem} />
      </Routes>
    </Router>
  );
}

export default App;
